                    <img width={300} height={100} alt="300x100" src="http://image.noelshack.com/fichiers/2018/41/3/1539165890-deezer.jpeg" />
                </Carousel.Item>
                <Carousel.Item>
                    <img width={300} height={100} alt="300x100" src="http://image.noelshack.com/fichiers/2018/41/3/1539165944-msc.png" />
                </Carousel.Item>
             </Carousel>
        )
    }
}

export default CarouselBandeau ;
